import './css/colors.css'


function Home() {
    axios.get(localStorage.getItem('url') + '/about.json')
    .then(function (res) {
        console.log(res.data);

        const temp = document.getElementById('content')
        console.log(temp)
        temp.innerHTML = res.data
    })
    .catch(function (err) {
        console.log(err)
    });

    return (
        <div className="App">
            <Navbar />
            <div id="content">
                Bienvenue sur ARE, merci d'utiliser la barre de navigation pour choisir
            </div>
        </div>
    );
}

export default Home
